/**
@author:- Anurag
@email:- anurag@c3ihub.iitk.ac.in

UserStorage contract is used to map user id to voter and candidate address, and to manage election verifier, approver.
The contract owner and admin have the authority to update voter, candidate, verifier, approver.

*/

// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.16;

import "./DataTypes.sol";
import "./VotingCommon.sol";
import "./Enums.sol";

contract UserStorage is VotingCommon {

    using EnumsLib for EnumsLib.EnumType;

    EnumsLib.EnumType public designations;
    EnumsLib.EnumType public roles;
    EnumsLib.EnumType public positions;

    // Mapping for User
    mapping(bytes32 => address) public userMap;
    mapping(address => bytes32) public userReverseMap;

    // Mapping for voter 
    mapping(bytes32 => Voter) public voterMap; // voter id => voter detail object
    mapping(bytes32 => address) public voterAddressMap; // voter id => voter address
    mapping(address => bytes32) public voterReverseMap; // address => id

    // Mapping for candidate
    mapping(bytes32 => Candidate) public candidateMap; // candidate id => candidate detail object
    mapping(bytes32 => address) public candidateAddressMap; // candidate id => candidate address
    mapping(address => bytes32) public candidateReverseMap; // address => id

    // Mapping for Election officer members
    mapping(bytes32 => Member) public memberMap; // member id => member object
    mapping(bytes32 => address) public memberAddressMap; // member id => address
    mapping(address => bytes32) public memberReverseMap; // address => id

    // Event emtted after a user added
    event UserAdded(bytes32 userId, address userAddress);
    event UserUpdated(bytes32 userId, address userAddress);
    event UserDeleted(bytes32 userId, address userAddress);

    // Event emmited after a voter added
    event VoterAdded(bytes32 voterId, address voterAddress);
    // Event emmited after a voter updated
    event VoterUpdated(Voter voter, address voterAddress);
    // Event emmited after a voter deleted
    event VoterDeleted(bytes32 voterId);

    // Event emmited after a candidate added
    event CandidateAdded(Candidate candidate, address candidateAddress);
    // Ememt emmited after a candidate update
    event CandidateUpdated(Candidate candidate, address candidateAddress);
    // Ememt emmited after a candidate deleted
    event CandidateDeleted(bytes32 candidateId);

    // Event emmited after a member added
    event MemberAdded(Member member, address memberAddress);
    // Event emmited after a member updated
    event MemberUpdated(Member member, address memberAddress);
    // Event emmited after a member deleted
    event MemberDeleted(bytes32 memberId);

    // Event emmited after vote cast function
    event VoteCast(bytes32 voterId, bytes32 positionId);

    // constructor to set the initial state of the contract
    constructor(
        address _admin,
        address _manager
    ) VotingCommon(_admin, _manager) {}


    // function to add designation value
    function addDesignation(string memory _designation) public {
        designations.addEnumType(_designation);
    }


    // function to add role value
    function addRole(string memory _role) public {
        roles.addEnumType(_role);
    }

    // function to add posiiton value
    function addPosition(string memory _position) public {
        roles.addEnumType(_position);
    }

    // function to get designation value
    function getDesignationValue(string memory _designation) public view returns(uint) {
        return designations.getEnumValue(_designation);
    }

    // function to get role value in int
    function getRoleValue(string memory _role) public view returns(uint) {
        return roles.getEnumValue(_role);
    }

    // function to get position value in int
    function getPositionValue(string memory _position) public view returns(uint) {
        return positions.getEnumValue(_position);
    }

/*
     * @dev Function to add a user
 * @param userId 12 bit uint id of the user
 * @param userAddress address of the user
 */
     function addUser(bytes32 userId, address userAddress) public  {
        // check is user already does not exist
        if(userMap[userId]!=address(0)){
            revert("User already exists, instead try updating the address");
        }
        // Update the user in the mapping
        userMap[userId] = userAddress;
        userReverseMap[userAddress]=userId;

        // Emit the UserAdded event
        emit UserAdded(userId, userAddress);
    }

    /*
     * @dev Function to update a user
 * @param userId 12 bit uint id of the user
 * @param userAddress address of the user
 */
    function updateUser(bytes32 _userId, address _userAddress) public  {
        // check if user already exists
        if(userMap[_userId]==address(0)){
            revert("user does not exist");
        }

        // Update the user in the mapping
        userMap[_userId] = _userAddress;
        userReverseMap[_userAddress]=_userId;

        // Emit the UserUpdated event
        emit UserUpdated(_userId, _userAddress);
    }

    /*
 * @dev Function to update a user
 * @param userId 12 bit uint id of the user
 * @param userAddress address of the user
    */
    function deleteUser(bytes32 _userId) public {
        address userAddress = userMap[_userId];
         if(userMap[_userId]==address(0)){
            revert("user does not exist");
        }
        // Update the user in the mapping
        userMap[_userId] = address(0);
        userReverseMap[userAddress]="";
        // Emit the UserUpdated event
        emit UserDeleted(_userId, userAddress);
    }

    /*
    Function to get user id
    */
    function getUserId(address userAddress) public view returns(bytes32){
        return userReverseMap[userAddress];
    }

    /*
    Function to get user address
    */
    function getUserAddress(bytes32 userId) public view returns(address){
        return userMap[userId];
    }


    /*
  Function for add voter
  @param detail object of the voter
  @param address of the voter
  */
    function addVoter(
        Voter memory _voter
    ) public  {
        address voterAddress = userMap[_voter.voterId];
        if (voterAddress == address(0)) {
            revert("Candidate account not created");
        }
        // check is user already does not exist
        if (voterAddressMap[_voter.voterId] != address(0)) {
            revert("Voter already exist");
        }
        // save details in function to store data in mapping
        saveVoterInMap(_voter, voterAddress);
        // emit voter added event
        emit VoterAdded(_voter.voterId, voterAddress);
    }

    /*
  Function for update voter
  @param detail object of the voter
  @param address of the voter
  */
    function updateVoter(
        Voter memory _voter
    ) public  {
        address voterAddress = userMap[_voter.voterId];
        // save details in function to store data in mapping
        saveVoterInMap(_voter, voterAddress);
        // emit voter added event
        emit VoterUpdated(_voter, voterAddress);
    }

    /*
  Function for storing value internally in mapping
  @param detail object of the voter
  @param address of the voter
  */
    function saveVoterInMap(
        Voter memory _voter,
        address _voterAddress
    ) internal {
        Voter storage voter = voterMap[_voter.voterId];
        voter.universityId = _voter.universityId;
        voter.voterId = _voter.voterId;
        voterMap[voter.voterId] = voter;
        voterAddressMap[_voter.voterId] = _voterAddress;
        voterReverseMap[_voterAddress] = _voter.voterId;
    }

    /*
  Function to delete voter
  @param detail object of the voter
  */
    function deleteVoter(
        bytes32 _voterId
    ) public {
        // check if voter already exist
        if (voterAddressMap[_voterId] == address(0)) {
            revert("Voter not exist");
        }
        address voterAddress = voterAddressMap[_voterId];
        delete(voterMap[_voterId]);
        delete(voterAddressMap[_voterId]);
        delete(voterReverseMap[voterAddress]);
        // emit voter deleted event
        emit VoterDeleted(_voterId);
    }

    /*
  Function to get voter id from voter address
  @param bytes voter id 
  */
    function getVoterId(address _voterAddress) public view returns (bytes32) {
        return voterReverseMap[_voterAddress];
    }

    /*
  Function to get voter each position status
  @param bytes voter id 
  */
    function getVoterAddress(bytes32 _voterId) public view returns (address) {
        return voterAddressMap[_voterId];
    }

    /*
  Function to get voter each position status
  @param bytes voter id 
  */
    function getVoterPositionStatus(
        bytes32 _voterId
    ) public view returns (bytes32[] memory) {
        return voterMap[_voterId].positionVote;
    }

    /*
  Function to get voter detail
  @param bytes voter id 
  */
    function getVoterDetail(
        bytes32 _voterId
    ) public view returns (Voter memory) {
        return voterMap[_voterId];
    }

    /*
  Function to get voter detail
  @param bytes voter address 
  */
    function getVoterDetailByAddress(
        address _voterAddress
    ) public view returns (Voter memory) {
        bytes32 voterId = voterReverseMap[_voterAddress];
        return voterMap[voterId];
    }

    /*
        CANDIDATE OPERATIONS
   */

    /*
  Function for add candidate
  @param detail object of the candidate
  */
    function addCandidate(Candidate memory _candidate) public {
        address candidateAddress = userMap[_candidate.candidateId];
        if (candidateAddress == address(0)) {
            revert("Candidate account not created");
        }
        // check for candidate address already exist
        if (candidateAddressMap[_candidate.candidateId] != address(0)) {
            revert("candidate already exist");
        }
        // save details in function to store data in mapping
        saveCandidateInMap(_candidate, candidateAddress);
        // emit candidate added event
        emit CandidateAdded(_candidate, candidateAddress);
    }

    /*
  Function for update candidate
  @param detail object of the candidate
  */
    function updateCandidate(Candidate memory _candidate) public {
        address candidateAddress = userMap[_candidate.candidateId];
        // check for candidate address not exist already
        if (candidateAddressMap[_candidate.candidateId] == address(0)) {
            revert("candidate not exist");
        }
        // save details in function to store data in mapping
        saveCandidateInMap(_candidate, candidateAddress);
        // emit candidate added event
        emit CandidateUpdated(_candidate, candidateAddress);
    }

    /*
  Function for storing value internally in mapping
  @param detail object of the candidate
  @param address of the candidate
  */
    function saveCandidateInMap(
        Candidate memory _candidate,
        address _candidateAddress
    ) internal {
        candidateMap[_candidate.candidateId] = _candidate;
        candidateAddressMap[_candidate.candidateId] = _candidateAddress;
        candidateReverseMap[_candidateAddress] = _candidate.candidateId;
    }

    /*
  Function to delete candidate
  @param detail object of the candidate
  */
    function deleteCandidate(
        bytes32 _candidateId
    ) public  {
        // check if candidate already exist
        if (candidateAddressMap[_candidateId] == address(0)) {
            revert("candidate not exist");
        }
        address candidateAddress = candidateAddressMap[_candidateId];
        delete(candidateMap[_candidateId]);
        delete(candidateAddressMap[_candidateId]);
        delete(candidateReverseMap[candidateAddress]);
        // emit candidate deleted event
        emit CandidateDeleted(_candidateId);
    }

    /*
  Function to get candidate id from candidate address
  @param bytes candidate id 
  */
    function getCandidateId(
        address _candidateAddress
    ) public view returns (bytes32) {
        return candidateReverseMap[_candidateAddress];
    }

    /*
  Function to get candidate each position status
  @param bytes candidate id 
  */
    function getCandidateAddress(
        bytes32 _candidateId
    ) public view returns (address) {
        return candidateAddressMap[_candidateId];
    }

    /*
  Function to get candidate detail
  @param bytes candidate id 
  */
    function getCandidateDetail(
        bytes32 _candidateId
    ) public view returns (Candidate memory) {
        return candidateMap[_candidateId];
    }

    /*
  Function to get candidate detail to address
  @param candidate address
  */
    function getCandidateByAddress(
        address _candidateAddress
    ) public view returns (Candidate memory) {
        bytes32 candidateId = candidateReverseMap[_candidateAddress];
        return candidateMap[candidateId];
    }

    /*
  Function to get candidate vote count
  @param bytes candidate id 
  */
    function getCandidateVotes(
        bytes32 _candidateId
    ) public view returns (uint256) {
        return candidateMap[_candidateId].voteCount;
    }

    /*
  Function to get candidate vote count from address
  @param address
  */
    function getCandidateVotesByAddress(
        address _candidateAddress
    ) public view returns (uint256) {
        bytes32 candidateId = candidateReverseMap[_candidateAddress];
        return candidateMap[candidateId].voteCount;
    }

    /*
  Function to get candidate position
  @param bytes candidate address
  */
    function getCandidatePositionByAddress(
        address _candidateAddress
    ) public view returns (bytes32) {
        bytes32 candidateId = candidateReverseMap[_candidateAddress];
        return candidateMap[candidateId].positionId;
    }

    /*
  Function to get candidate position
  @param bytes candidate id 
  */
    function getCandidatePosition(
        bytes32 _candidateId
    ) public view returns (bytes32) {
        return candidateMap[_candidateId].positionId;
    }

    /*
        ELECTION OFFICER MEMBER OPERATIONS
    */

    /*
  Function for add member
  @param detail object of the member
  */
    function addMember(Member memory _member) public {
        address memberAddress = userMap[_member.memberId];
        if (memberAddress == address(0)) {
            revert("member account not created");
        }
        // check for member address not exist already
        if (memberAddressMap[_member.memberId] != address(0)) {
            revert("member already exist");
        }
        // save details in function to store data in mapping
        saveMemberInMap(_member, memberAddress);
        // emit member added event
        emit MemberAdded(_member, memberAddress);
    }

    /*
  Function for update member
  @param detail object of the member
  */
    function updateMember(Member memory _member) public {
        address memberAddress = userMap[_member.memberId];
        // check for member address not exist already
        if (memberAddressMap[_member.memberId] == address(0)) {
            revert("Member not exist");
        }
        // save details in function to store data in mapping
        saveMemberInMap(_member, memberAddress);
        // emit member added event
        emit MemberUpdated(_member, memberAddress);
    }

    /*
  Function for storing value internally in mapping
  @param detail object of the member
  @param address of the member
  */
    function saveMemberInMap(
        Member memory _member,
        address _memberAddress
    ) internal {
        memberMap[_member.memberId] = _member;
        memberAddressMap[_member.memberId] = _memberAddress;
        memberReverseMap[_memberAddress] = _member.memberId;
    }

    /*
  Function to delete member
  @param detail object of the member
  */
    function deleteMember(
        bytes32 _memberId
    ) public  {
        // check if member already exist
        if (memberAddressMap[_memberId] == address(0)) {
            revert("member not exist");
        }
        address memberAddress = memberAddressMap[_memberId];
        delete(memberMap[_memberId]);
        delete(memberAddressMap[_memberId]);
        delete(memberReverseMap[memberAddress]);
        // emit member deleted event
        emit MemberDeleted(_memberId);
    }

    /*
  Function for get member id by address
  @param address
  */
    function getMemberId(address _memberAddress) public view returns (bytes32) {
        return memberReverseMap[_memberAddress];
    }

    /*
  Function for get member address by id
  @param bytes member id
  */
    function getMemberAddress(bytes32 _memberId) public view returns (address) {
        return memberAddressMap[_memberId];
    }

    /*
  Function for get member details by id
  @param address
  */
    function getMemberDetail(
        bytes32 _memberId
    ) public view returns (Member memory) {
        return memberMap[_memberId];
    }

    /*
  Function for get member roles by id
  @param address
  */
    function getMemberRoles(
        bytes32 _memberId
    ) public view returns (uint8[] memory) {
        return memberMap[_memberId].roles;
    }

    /*
  Function for get member detail by address
  @param address
  */
    function getMemberByAddress(
        address _memberAddress
    ) public view returns (Member memory) {
        bytes32 memberId = memberReverseMap[_memberAddress];
        return memberMap[memberId];
    }

    /*
  Function for get member roles by address
  @param address
  */
    function getMemberRolesByAddress(
        address _memberAddress
    ) public view returns (uint8[] memory) {
        bytes32 memberId = memberReverseMap[_memberAddress];
        return memberMap[memberId].roles;
    }

    /*
    Function to vote cast
    */
    function voteCast(bytes32 _positionId, bytes32 _candidateId) external {
        bytes32 voterId = voterReverseMap[msg.sender];
        Voter storage voter = voterMap[voterId]; 
        Candidate memory candidate = getCandidateDetail(_candidateId);

        for(uint i=0; i<voter.positionVote.length; i++){
            if(voter.positionVote[i] == _positionId){
                revert("Vote already exist to given position");
            }
        }

        voter.positionVote.push(_positionId);
        candidate.voteCount += 1;
        emit VoteCast(voterId, _positionId);
    }
}
